"use strict";

function initTimepickerBasic() {
  $("#basicTimepicker").timepicker();
}
function initTimepickerDuration() {
  $("#durationTimepicker").timepicker({
    minTime: "2:00pm",
    maxTime: "11:30pm",
    showDuration: !0
  });
}
function initTimepickerDisable() {
  $("#disableTimeRangesTimepicker").timepicker({
    disableTimeRanges: [["12am", "3am"], ["4am", "4:30am"], ["10am", "11:30am"]]
  });
}
function initTimepickerTimeformat() {
  $("#timeformatTimepicker1").timepicker({
    timeFormat: "H:i:s"
  }), $("#timeformatTimepicker2").timepicker({
    timeFormat: "h:i A"
  });
}
function initTimepickerDatepair() {
  $("#datepairExample .time").timepicker({
    showDuration: !0,
    timeFormat: "g:ia"
  }), $("#datepairExample .date").datepicker({
    format: "m/d/yyyy",
    autoclose: !0
  }), $("#datepairExample").datepair();
}
initTimepickerBasic(), initTimepickerDuration(), initTimepickerDisable(), initTimepickerTimeformat(), initTimepickerDatepair();